--
-- Создать представление `view_cars_list`
--
CREATE
DEFINER = 'root'@'localhost'
VIEW view_cars_list
AS
SELECT
  `cars`.`IDcar` AS `IDcar`,
  `car_marks`.`markName` AS `markName`,
  `car_models`.`modelName` AS `modelName`,
  `car_gens`.`genName` AS `genName`,
  `car_transmissions`.`transName` AS `transName`
FROM ((((`car_models`
  JOIN `car_marks`
    ON ((`car_models`.`IDmark` = `car_marks`.`IDmark`)))
  JOIN `car_gens`
    ON ((`car_gens`.`IDmodel` = `car_models`.`IDmodel`)))
  JOIN `cars`
