--
-- Создать представление `view_storage`
--
CREATE
DEFINER = 'root'@'localhost'
VIEW view_storage
AS
SELECT
  `storage`.`IDstorage` AS `IDstorage`,
  `storage`.`IDgc` AS `IDgc`,
  `goods_catalog`.`gcName` AS `gcName`,
  `goods_catalog`.`Articul` AS `Articul`,
  `goods_catalog`.`IDtg` AS `IDtg`,
  `type_goods`.`tgName` AS `tgName`,
  `car_marks`.`markName` AS `markName`,
  `car_models`.`modelName` AS `modelName`,
  `car_gens`.`genName` AS `genName`,
  `storage`.`sCount` AS `sCount`
FROM ((((((`storage`
  JOIN `goods_catalog`
    ON ((`storage`.`IDgc` = `goods_catalog`.`IDgc`)))
  JOIN `type_goods`
    ON ((`goods_catalog`.`IDtg` = `type_goods`.`IDtg`)))
  JOIN `cars`
    ON ((`goods_catalog`.`IDcars` = `cars`.`IDcar`)))
  JOIN `car_models`
    ON ((`cars`.`IDmodels` = `car_models`.`IDmodel`)))
  JOIN `car_marks`
    ON (((`car_models`.`IDmark` = `car_marks`.`IDmark`)
    AND (`cars`.`IDmarks` = `car_marks`.`IDmark`))))
  JOIN `car_gens`
    ON (((`car_gens`.`IDmodel` = `car_models`.`IDmodel`)
    AND (`cars`.`IDgens` = `car_gens`.`IDgen`))));

--
-- Создать представление `view_selector_goods`
--
CREATE
DEFINER = 'root'@'localhost'
VIEW view_selector_goods
AS
