--
-- Создать представление `view_operation_goods_list`
--
CREATE
DEFINER = 'root'@'localhost'
SQL SECURITY INVOKER
VIEW view_operation_goods_list
AS
SELECT
  `op_goods_list`.`IDoperation` AS `IDoperation`,
  `op_goods_list`.`IDgc` AS `IDgc`,
  `type_goods`.`tgName` AS `tgName`,
  `goods_catalog`.`gcName` AS `gcName`,
  `car_marks`.`markName` AS `markName`,
  `car_models`.`modelName` AS `modelName`,
  `car_gens`.`genName` AS `genName`,
  `op_goods_list`.`ocCount` AS `ocCount`,
  `goods_catalog`.`gcCost` AS `gcCost`,
  (`op_goods_list`.`ocCount` * `goods_catalog`.`gcCost`) AS `ogcFCost`
FROM ((((((`op_goods_list`
  JOIN `goods_catalog`
    ON ((`op_goods_list`.`IDgc` = `goods_catalog`.`IDgc`)))
  JOIN `type_goods`
    ON ((`goods_catalog`.`IDtg` = `type_goods`.`IDtg`)))
  JOIN `cars`
    ON ((`goods_catalog`.`IDcars` = `cars`.`IDcar`)))
  JOIN `car_marks`
    ON ((`cars`.`IDmarks` = `car_marks`.`IDmark`)))
  JOIN `car_models`
    ON (((`cars`.`IDmodels` = `car_models`.`IDmodel`)
    AND (`car_models`.`IDmark` = `car_marks`.`IDmark`))))
  JOIN `car_gens`
    ON (((`cars`.`IDgens` = `car_gens`.`IDgen`)
    AND (`car_gens`.`IDmodel` = `car_models`.`IDmodel`))));

